function FilterButton(props) {
    return (
        <div>
            <button 
                type="button" 
                className="btn toggle-btn" 
                aria-pressed="true"
                onClick={() => {props.setFilter(props.name)}}
            >
                <span className="visually-hidden">Show </span>
                <span>all</span>
                <span className="visually-hidden"> tasks</span>
            </button>
        </div>
    )
}

export default FilterButton;
